import 'bootstrap/dist/css/bootstrap.min.css';

const Layout = ({ children }) => <div className="layout">{children}</div>

export default function App(props) {
  return (
    <Layout>
      <props.Component {...props.pageProps} />
    </Layout>
  )
}
